import Services from './components/pages/Services';
import Products from './components/pages/Products';
import SignUp from './components/pages/SignUp';


function App() {
  return (
    <>
      <Router>
        <Navbar />
          <HomeSection id="home" />
        <AboutSection />

        <LearningSection/>
        <div id="volunteer">
        <VolunteerSection/>
        </div>
        <div id="contact"></div>




      </Router>
    </>
  );
}

export default App;
